var request = require('request');
var path = require('path');
var fs = require('fs');
const Axios = require('axios')

let allImgReq = [];
fs.readFile(path.join(__dirname, 'archive.org.har'), 'utf8', (err, data) => {
    if (err) {
      console.log(err)
      return
    }
    let allJson = JSON.parse(data);
    let entries = allJson.log.entries;
    for (let k in entries) {
        let content = entries[k].response.content;
        let url = entries[k].request.url;
        if (content.mimeType.indexOf('image') >= 0 && url.indexOf('.us.archive.org/BookReader/BookReaderPreview.php') >= 0) {
            allImgReq.push(url);
            console.log(url);
        }
    }
    console.log(allImgReq.length)
});



